import React, { Component } from 'react';
import Card from "react-bootstrap/Card";
import Button from "react-bootstrap/Button";

import ShoppingList from "../img/projects/shopping_list.PNG";
class Projects extends Component {
    state = {  }
    render() { 
        return ( <div id="projects" className="section">
            <Card style={{ width: '18rem' }}>
  <Card.Img variant="top" src={ShoppingList} />
  <Card.Body>
    <Card.Title>Shopping List Web App</Card.Title>
    <Card.Text>
      A grocery shopping list static web application built using React.js.
    </Card.Text>
    <Button variant="primary" href="https://lin-michael.github.io/react_shopping_list/">Go somewhere</Button>
  </Card.Body>
</Card>



        </div> );
    }
}
 
export default Projects;
